  const [apiData,setApiData] = useState({});

  useEffect(() => {
    fetch("/api").then(
      response => response.json(),
    ).then(
      (data) => {setApiData(data);
      console.log(data);
      console.log(apiData);
    }
    )
  },[flag])

  return (
    <Router>
      <Routes>
        <Route path='/' element={
        <Home onApiData= {apiData}/>
        }/>
        <Route path='/admin' element={<SigninPage />}  />
      </Routes>
    </Router>
  );
}

export default App;
